import { Component } from "react"
class Output extends Component {
  render(){
    return (
      <section className='flex-1'>
          <div className='w-full border h-screen border-l-orange-500 p-10 ml-20 text-black'>{this.props.value}</div>
      </section>
    )
  }
}
export default Output;
